import React from 'react';
import { styled } from 'styled-components';

const LastStepCheckOutPage = () => {
  return (
    <Container>
      <LayOut></LayOut>
    </Container>
  );
};

export default LastStepCheckOutPage;

const Container = styled.div`
  max-width: 1230px;
  margin: 0 auto;
  margin-top: 100px;
`;

const LayOut = styled.div`
  width: 100%;
  padding: 20px;
`;
